class Node:
    def __init__(self, data):
        self.data = data
        self.next = None

class LinkedList:
    def __init__(self):
        self.head = None

    def remove_duplicates(self):
        current = self.head
        while current:
            temp = current
            while temp.next:
                if temp.next.data == current.data:
                    temp.next = temp.next.next
                else:
                    temp = temp.next
            current = current.next
